import React from "react";

const headTop = () => {
  return (
    <div className="header-top">
      <ul className="links">
        <li>My Account</li>
        <li>My Shopping Bag</li>
      </ul>

      <style jsx>{`
        .header-top {
          width: 100%;
          height: 50px;
          padding: 0px 20px;
          background-color: #24272b;
          color: white;
          display: flex;
          justify-content: flex-end;
          align-items: center;
        }

        .links {
          display: flex;
        }

        .links li {
          padding: 0px 0px 0px 20px;
        }
      `}</style>
    </div>
  );
};
export default headTop;
